import "./index.scss";
import NavBar from "../components/NavBar"
import LoginPage from "../components/LoginPage"
import WindowLayout from "../components/WindowLayout";
import { useRouter } from 'next/router'


const login = () => alert("hi")

const Index = () => 
{const router = useRouter()
  console.log("ROUTER:******************************************")
  console.log(router)
  router.query
  return <WindowLayout height="380px" width="380px" logo auth="joe">
  <LoginPage/>
</WindowLayout>}

// const Index = () => <div>
//   <NavBar login={login} auth="joe"/>
//   <LoginPage/>
//</div>

export default Index
